import resume from "../images/Resume/Resume_Latest.pdf";
import React from 'react';
import Iframe from 'react-iframe';
{/* 1250x920 */}
export default function ProjectsPage() {
    return (
        <Iframe url="../images/Resume_Latest.pdf"
                src={resume}
                id="myId"
                width="1250px"
                height="1620px"
                display="initial"
                position="relative"/>
    );
}
